import React from "react";
import { useGlobalContext } from "../context";

export default function Meal(){
    const { meals } = useGlobalContext()
    console.log(meals)
   
    return (
        <section> 
            { meals.map((me)=>{
            return (
                <div key={me.idMeal} className='card'>
                 <img scr='https://www.themealdb.com/images/media/meals/wxywrq1468235067.jpg' alt='img1'/>
}
                 <h4>{ me.strMeal}</h4>

                </div>
                
            )
        })}
       </section> 

    )
}
